import React from 'react';

const Current = props => {
    return (
        <div position="absolute">
            <img src="https://www.w3schools.com/images/picture.jpg" alt="Mountain" />
            <div className="title">
                {props.title}
            </div>
            <div className="buttons">
                <img src="https://www.w3schools.com/images/picture.jpg" alt="Mountain" />
            </div>
        </div>
    );
}

export default Current;
